import React from 'react'
import { Table } from "antd"

const COLUMNS = [
    { title: 'Property', key: 'name' },
    { title: 'Range / Description', key: 'range'}
]

export const PropertyTable = ({ items = [] }) => (
    <Table dataSource={items} columns={COLUMNS} />
)


export default PropertyTable;
